(68, 'realme', 'Smart Watch S', '../assets/products/eefa660dd25a6c9837bcbfd9a64fd376realme.jpg', '2022-03-13 09:02:44', 'smart watches', 'Premium look and high durability with Aluminum Alloy case & Corning Gorilla Glass 3\r\n3.3cm (1.3 inch) TFT-LCD Touchscreen with Auto-Brightness adjustment. Adjustable length : 164-208mm\r\n360x360 pixels resolution with up to 600 nits Brightness\r\nContinous Heart Rate Monitor & Blood Oxygen (SpO2) Monitor\r\nSmart Notifications - displays incoming call alerts and other notifications on your wrist\r\nSmart Controls - Controls your music and clicks pictures on-the-go\r\nIP68 Water Resistant with 16 Sport Modes'),
(69, 'Samsung', 'Galaxy Watch Active 2', '../assets/products/9d406f514a07681f4aeb700c6894030a71W1oy5wnFL._SX679_.jpg', '2022-03-13 09:05:08', 'smart watches', 'country of origin:India\r\nSuper AMOLED display with customizable Always on Watchfaces\r\nConnectivity Bluetooth 5.0\r\n39 built in trackers with 50m Water Resistance\r\nGalaxy Watch 4G can be activated only with Samsung Galaxy Smartphones (Android 5.0 & 1.5GB or higher) for using in standalone 4G mode\r\n24/7 Activity Tracking - 4 stage Sleep, Activity with continuous HRM & Stress monitoring\r\nDisplay Size: 3.45cm (1.4\"); Resolution: 360 x 360'),
(71, 'Apple', 'Series 7', '../assets/products/ff9ddf5ffb8b8513b46a4693bc42acb8ap.jpg', '2022-03-13 09:08:28', 'smart watches', 'Attend calls and reply to messages using the GPS model\r\nwith the latest inbuilt sensor you can measure your level of blood oxygen\r\nWith an in-built ECG, you can track your heart movements\r\nAlways-On Display\r\n5GHz Wi-Fi and U1 Ultra Wideband chip\r\nuse fitness app on your iphone to see your daily activity trends\r\nApple Watch Series 7\r\nWith Call Function\r\nTouchscreen\r\nNotifier, Fitness & Outdoor\r\nBattery Runtime: Upto 18 hrs'),
(72, 'Fossil', 'Gen 6', '../assets/products/d6751e201851eb5810db426108e14e69android-ios-ftw4062-fossil-no-original-imag7egnvftshgyn.jpg', '2022-03-13 09:10:36', 'smart watches', 'Closure\r\nStrap Buckle\r\nSensor\r\nAccelerometer, Altimeter, Ambient Light, Compass, Gyroscope, Off-body IR, PPG Heart Rate, SPO2\r\nCompatible Device\r\nAndroid 6.0+ (excluding Go edition), iOS 12.0+\r\nNotification\r\nYes\r\nNotification Type\r\nAlarm Clock, App Alerts, Calendar Alerts, Email, Multiple Time Zones, Social Media, Text\r\nBattery Type\r\nLithium Ion\r\nCharge Time\r\n30 Min\r\nBattery Life\r\n24 Hr + Multi Day Extended Mode\r\nRechargeable Battery\r\nYes\r\nCharger Type\r\nWireless'),
(73, 'FitBit', 'Sense', '../assets/products/edb6072c9ca3535d143cd2a5647dd478fitbit.jpg', '2022-03-13 09:12:44', 'smart watches', 'Sales Package\r\nSmartwatch with Small Band Strap, Additional Large Band Strap, Charging Cable, Instruction Manual\r\nModel Number\r\nFB512BKBK\r\nModel Name\r\nSense\r\nDial Shape\r\nCurved\r\nStrap Color\r\nBlack\r\nStrap Material\r\nElastomer\r\nSize\r\nRegular\r\nTouchscreen\r\nYes\r\nWater Resistant\r\nYes\r\nWater Resistance Depth\r\n50 m\r\nUsage\r\nFitness & Outdoor\r\nDial Material\r\nStainless Steel\r\nIdeal For\r\nMen & Women'),
(76, 'GARMIN', 'Lily', '../assets/products/f04ff7f19a6cd772f4f4ea00710799ff25-010-02384-50-android-ios-garmin-original-imagyy67vg8kpmqz.png', '2022-03-13 09:17:53', 'smart watches', 'Lily is the small and stylish smartwatch you’ve been waiting for. With a flick of your wrist or a tap of your finger, the stylish patterned lens lights up to reveal a bright touchscreen display that disappears when you’re done with it. Always be connected to what matters with call, text and email notifications right on your wrist. This smartwatch even tracks steps, sleep, heart rate, energy levels, women’s health data and more to help keep up with your lifestyle. And — with a battery that lasts up to 5 days between charges — it really can keep up. Lily must be connected to the Garmin Connect app on your compatible smartphone.'),
(77, 'SamSung', 'Galaxy Active 2', '../assets/products/7163e1da19b72cef609dd47b2dff78ecsm-r825fzsiinu-android-ios-samsung-original-imafuenxfwab5z76.png', '2022-03-13 09:20:07', 'smart watches', 'Closure\r\nStrap Buckle\r\nSensor\r\nAccelerometer, Barometer, Gyro Sensor, Heart Rate Sensor, Light Sensor\r\nCompatible Device\r\niPhone 5 and Above (iOS 9.0 or Above), Android Smartphones (Android 5.0 or Higher)\r\nNotification\r\nYes\r\nNotification Type\r\nVibration\r\nBattery Type\r\nLithium Polymer\r\nBattery Life\r\nOver 60 Hours (Typically Based on Usage)\r\nRechargeable Battery\r\nYes\r\nCharger Type\r\nCharging Dock\r\nOther Features\r\nTimeless Design with Digital Touch Bezel, Make and Receive Calls Even without Your Phone, Location Technology: GPS, Glonass, Beidou, Galileo, Bluetooth Profiles: A2DP, AVRCP, HFP, HSP, 340 mAh Li-Polymer Battery, IP68 Rating, Military Grade Durability'),
(78, 'boAt', 'Storm RLT', '../assets/products/83bcc682f7551e2a61adcee35ca6d4fbdownload.png', '2022-03-13 14:16:43', 'smart watches', 'Performance Features\r\n210 mAh battery provides battery life Upto 8 to 10 days (Based on Usage), 2.5 Hours Charging Time'),
(79, 'Garmin', 'Forerunner 245', '../assets/products/cc4bd070fe79958ba529487071cee41bforerunner-245-yellow.png', '2022-03-13 14:20:31', 'smart watches', 'Garmin Forerunner 245 Smartwatch has the tools to help you put on an outstanding show every time you lace up your shoes. Safety and tracking features, such as built-in incident detection, make it easy to share your location. It also has activity profiles for cycling, pool swimming, indoor rowing and even for using the elliptical or stair-stepper. Create your own custom workouts, or download free ones that sync right to your watch. It tracks your light, deep and REM stages of sleep, along with movement throughout the night.\r\nControls Smartphone Music\r\nMonitor your heart rate, activity and stress tracking\r\nResponse or reject phone call with text (Android only)\r\nFunctions: Step counter, Distance Traveled, Calories Burned, Move IQ'),
(80, 'Lenovo', 'IdeaPad Flex 5', '../assets/products/67e9378636499e97a021fd52eccd6c14MP000000011276245_437Wx649H_202111261909321.jpeg', '2022-03-13 14:28:18', 'laptop', 'Stay in sync with the latest technology with the Lenovo IdeaPad Flex 5 laptop. The 14-inch FHD display along with Intel Iris Xe graphics will bring entertainment and content to life. Its 512GB SSD can store a large amount of data with ease. It comes with the 11th Gen Intel Core i5 processor and an 8GB DDR4 RAM that ensures high-speed performance. Furthermore, the Windows 11 Home operating system never lets you slow down on your creativity.'),
(81, 'Asus', 'X409FA', '../assets/products/eb63a27d051896dcbab92eaaae0e521eMP000000010301335_437Wx649H_202108160850521.jpeg', '2022-03-13 14:29:50', 'laptop', 'Accelerate your creativity with this Asus laptop and get all your tasks done. The latest 10th Gen Intel Core i3 processor will handle anything you throw at it with ease. Its Windows 10 Home operating system and 4 GB DDR4 RAM make it highly efficient. The 14-inch FHD display delivers vivid and smoother images. Moreover, with its 1 TB HDD, you can store all your large files with ease.'),
(82, 'HP', 'Pavilion Aero 13', '../assets/products/5aea802afd363ab1b93e58ff1a500791MP000000011570569_437Wx649H_202112251101351.jpeg', '2022-03-13 14:31:07', 'laptop', 'Keeping the demanding needs of the technology in mind, this HP Pavilion Aero laptop will make every experience more powerful and real. It has a 13.3-inch WUXGA display with AMD Radeon graphics that brings entertainment and content to life. Powered by the AMD Ryzen 5 processor and 16GB DDR4 RAM, it provides responsive and powerful performance. Equipped with 512GB SSD storage will give you enough space to store all your files and folders.'),
(83, 'Dell', 'Inspiron 3511', '../assets/products/dab1aa91e86bb40741102d5417049da2MP000000011635064_437Wx649H_202201010157441.jpeg', '2022-03-13 14:32:29', 'laptop', 'With a unique combination of compact design and impeccable performance, this Dell Inspiron 3511 laptop will not fail to impress you. It is equipped with 8GB RAM and an 11th Generation Intel Core i3 processor for lightning-fast speed. It can store big files and documents in its spacious 1TB HDD + 256GB SSD without worrying about slowing down its speed. The 15.6-inch FHD screen with Intel Integrated UHD graphics enhances the viewing experience.');

